import React, { Component } from "react";
import Container from "react-bootstrap/Container";
import Card from "react-bootstrap/Card";

const Cost = (props) => {
  return (
    <div>
      <Container
        style={{
          alignitems: "center",
          textAlign: "left",
          fontWeight: "bold",
          color: "blue",
        }}
      >
        <Card>
          <Card.Body>
            <h1> {console.log(this.state)} </h1>
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
};
